  const [data, setData] = useState([]);
  useEffect(() => {
    axios
      .get(`https://jsonplaceholder.typicode.com/posts`).then(res=>{
          console.log(res.data)
          setData(res.data);
      }).catch(err=>{
          console.log(err);
      })
  }, []);





